import { useState } from "react"

function Register(){
    const [name,setName]=useState("")
    const [email,setEmail]=useState("")
    const [pss,setPss]=useState("")
    return(
        <>
        <div className="register">
            <input type="name" placeholder="Enter name" value={name} onChange={(e)=>setName(e.target.value)} />
            <input type="email" placeholder="Enter email id" value={email} onChange={(e)=>setEmail(e.target.value)} />
            <input type="password" placeholder="Enter password" value={pss} onChange={(e)=>{setPss(e.target.value)}} />
            <button>Login</button>
            <button>Registeration</button>
        </div>
        </>
    )
}
export default Register
